import React from "react";
import './Chess.css';
import chessimg from '../img1.jpg'
function Chess() {
    return (
        <div className="Chess">


            <div >
                <h1>Chess</h1>
                <img src={chessimg} alt="React Logo" />
            </div>

        </div>
    );
}

export default Chess;
